export default function CartItem({id, category, description, price, title}) {
    return (
        <article>
            <h4>{id}</h4>
            <h4>{category}</h4>
            <h4>{description}</h4>
            <h4>{price}</h4>
            <h4>{title}</h4>
        </article>
    )
}
